"234740":{"id":"234740","name":"My New Boss is Goofy","slug":"my-new-boss-is-goofy","original_title":"新しい上司はど天然","overview":"Após um chefe autoritário e abusivo ter destruído seu ânimo e sua saúde, Momose deixa seu emprego para começar uma nova carreira na área de vendas em uma agência de publicidade. No entanto, logo no primeiro dia de trabalho, Momose fica incapacitado devido a uma dor de estômago causada por traumas passados... E se esse novo chefe for igual ao anterior? É nesse momento que seu novo chefe, Shirosaki, o leva para visitar clientes. O que será que Shirosaki planeja fazer? A natureza inesperadamente \"boba\" desse chefe com certeza vai curar qualquer ferida do passado!","first_air_date":"2023-10-07","episode_run_time":24,"vote_average":6.9,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["A-1 Pictures","Aniplex","Akita Shoten","ABC Animation","ABC Frontier","movic","BS11","Tokyo MX"],"genres":["Animação","Comédia"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/gxiXnVUqZ4RMtyZqJ6NMfuSeHUT.jpg","poster_path":"https://image.tmdb.org/t/p/original/r3NkqEBdjrgnMHFl8cIwv43gRln.jpg","cast":["Yuichiro Umehara","西山宏太朗","Tomokazu Sugita","Jun Fukuyama","Hiro Shimono"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/rps48RKcfxuTKrUBy6cy7KstpTG.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/rps48RKcfxuTKrUBy6cy7KstpTG.jpg","air_date":"2023-10-07","episode_count":12,"overview":"N/A","vote_average":5.4,"episodes":{"1":{"name":"Um pouco quebrada!!","overview":"Kentaro Momose desenvolveu sérios problemas após sofrer assédio moral de seu antigo chefe. O rapaz mudou de empresa, mas continua com o receio de ter um novo chefe abusivo. Para a sua surpresa, seu novo chefe é um bobão!","air_date":"2023-10-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/kuLZi7apS2bvDZ49na5qAXVajHi.jpg","vote_average":5},"2":{"name":"Quer que te carregue nas costas?","overview":"Momose e Shirosaki vão a um parque de diversões para um novo projeto. Lá, o novo funcionário aprende lições valiosas com seu querido chefe.","air_date":"2023-10-14","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4cXX0gEyqK7L2OHmJHuHl7GXYbV.jpg","vote_average":6},"3":{"name":"Patinhas, patinhas, patinhas...","overview":"Momose e Shirosaki encontram um gato abandonado na rua, que não reage nada bem a Shirosaki. É o possível começo de uma relação fofinha e peluda...","air_date":"2023-10-21","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/vddajWF6ym8VUSYrkfhzwScoF6z.jpg","vote_average":6},"4":{"name":"Quer Morar Comigo?","overview":"Aigo Kinjo está cansado do seu chefe abusivo e se transfere para a empresa de Momose e Shirosaki. Ele se torna subordinado de Aoyama, que tem expectativas de finalmente ser notado!","air_date":"2023-10-28","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/aUx5sp4y180wLNEj2nDuwxhuian.jpg","vote_average":5},"5":{"name":"Olhinhos de Mel!","overview":"Momose parte para uma viagem a negócios de dois dias com Shirosaki. Enquanto isso, Kinjo e Aoyama visitam a Kumatte Land para criar uma propaganda para o parque de diversões do Kumattechan!","air_date":"2023-11-04","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hAhpvWEfOu0y30NQE95yg9yBVeq.jpg","vote_average":5},"6":{"name":"Ex-namorado? Ex-namorado?? Ex-namorado???","overview":"Momose precisa pensar em novas propostas para o anúncio do aquário. Durante o processo, os traumas a respeito do seu antigo chefe retornam ao rapaz.","air_date":"2023-11-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/rMq4bgJC3mnqqVoKRk6eDcYEVHK.jpg","vote_average":6},"7":{"name":"A Verdade Chocante...!!","overview":"Após a ameaça do seu ex-chefe, Momose passa a morar na casa de Shirosaki. A proximidade dos dois faz com que Momose dê um passo importante...","air_date":"2023-11-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/qTcMuH4ybQQ3TrEISmqzwdWMTzF.jpg","vote_average":0},"8":{"name":"Quer Visitar a Casa da Minha Família?","overview":"Momose e Shirosaki vão a trabalho para a província de Akita, terra natal de Shirosaki. Aproveitando a viagem, eles visitam a casa da vovó do gerente!","air_date":"2023-11-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/uqjgCy7qhGphiSq3KL3OjYCgZrS.jpg","vote_average":5},"9":{"name":"Eu Vou Escutar Isso?!","overview":"Ao descobrir que Kinjo é fã de animes, Shirosaki o convida para beber a sós para tirar algumas dúvidas, e uma nova porta se abre! Sem querer ficar para trás, o Chefe Aoyama convida Momose para jantar e se conhecerem melhor.","air_date":"2023-12-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/k2hkVun8P90HuqZonOv2vk1ESk.jpg","vote_average":5},"10":{"name":"Se Responsabilize Por Isso!","overview":"Os dias de Momose no novo emprego se tornaram muito divertidos! Ao lado do seu novo chefe, o rapaz vive diversos episódios agradáveis em sua vida cotidiana.","air_date":"2023-12-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/pewEqBjkdtoRc8PEDB1OqrboNnf.jpg","vote_average":0},"11":{"name":"Preciso Encontrar Um Lugar Para Morar!","overview":"O primeiro anúncio criado por Momose está prestes a entrar em circulação! Fora do escritório, o rapaz inicia a sua busca por um apartamento novo.","air_date":"2023-12-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/7GErcTzvsGxqLNWQK8hqhvN9VP2.jpg","vote_average":0},"12":{"name":"Volte Logo...?!","overview":"Momose continua a sua busca por um novo apartamento. Na firma, Momose, Shirosaki, Kinjo e o Chefe Aoyama decidem se juntar para uma festinha de Natal.","air_date":"2023-12-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/1R3DvkrYPfiPTowH1w3JeHHVeQH.jpg","vote_average":0}}}}},
