"105721":{"id":"105721","name":"Burning Kabaddi","slug":"burning-kabaddi","original_title":"灼熱カバディ","overview":"Tatsuya Yogoshi era um famoso jogador de futebol, conhecido como o Inderrubável, que decidiu largar o esporte ao entrar no colegial. Contudo, ele recebe um convite para integrar um clube esportivo. O esporte deles é um esforço colaborativo, onde jogadores trabalham em equipe para capturar e derrubar inimigos que invadem seu território - uma verdadeira \"arte marcial em movimento.\" O nome desse esporte é... Kabaddi!","first_air_date":"2021-04-03","episode_run_time":24,"vote_average":7.6,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["TMS Entertainment","domerica"],"genres":["Animação","Comédia"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/nN4OVdex64ZeNV1DWmpfqC8MPGu.jpg","poster_path":"https://image.tmdb.org/t/p/original/dQ54BKvJBtVlR7yyKj7dcrUMmuS.jpg","cast":["Shuichi Uchida","Nobuhiko Okamoto","Yuma Uchida","佐藤元","Makoto Furukawa"],"trailer":"9x8cjXezXuM","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/jNFZ9Qn56yj6QDK1CoaJmCE8qTn.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/jNFZ9Qn56yj6QDK1CoaJmCE8qTn.jpg","air_date":"2021-04-03","episode_count":12,"overview":"N/A","vote_average":2,"episodes":{"1":{"name":"O que é Kabaddi?","overview":"Yoigoshi Tatsuya é um colegial que já foi conhecido no mundo dos esportes por jogar futebol muito bem. Contudo, devido a diversos problemas, ele quer distância da vida como esportista. Porém, sua fama não permite que fique em paz.","air_date":"2021-04-03","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4xe0gaDz9sMnlG5eTeZEEW60gKT.jpg","vote_average":2},"2":{"name":"Homens que Conectam","overview":"Yoigoshi é forçado a entrar no clube de kabaddi depois de perder uma aposta e aos poucos vai aprendendo que o esporte é mais profundo do que imaginava.","air_date":"2021-04-10","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dmTlvdoNUEycu68ixvGb28S8YwJ.jpg","vote_average":0},"3":{"name":"Mundo Ardente","overview":"Como membro recém-inscrito, Yoigoshi ainda está aprendendo o básico de kabaddi e ainda não compreende alguns pontos do esporte. Apesar de saber que é cooperativo, ele se vê em um beco sem saída por ser obrigado a trabalhar em equipe.","air_date":"2021-04-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/t3Qtzq8P6z1XfOrIbH0cGMBYy4P.jpg","vote_average":0},"4":{"name":"O Atacante mais Forte","overview":"Depois de estar no clube de kabaddi por cerca de um mês, Yoigoshi ainda não conhece algumas regras sobre o esporte, além de ter dúvidas sobre como pode melhorar suas habilidades.","air_date":"2021-04-24","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/oEAYaPsKeiis5STYZV1QBrpukzG.jpg","vote_average":0},"5":{"name":"A Partida Começa!!!","overview":"Depois do retorno do capitão Ojou, Yoigoshi fica pensativo sobre as habilidades de seu veterano. E para aproveitar que o clube está com mais membros, Ojou resolve marcar um amistoso com um velho conhecido.","air_date":"2021-05-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/5ZtxZXdaUeJLPiXQOQKGTBluodA.jpg","vote_average":0},"6":{"name":"Perseguição X Contra-ataque","overview":"A partida entre Noukin e Souwa acabou de começar. Yoigoshi mostra o que tem aprendido, mas o ace do time adversário, Takaya, mostra que tem muito a oferecer.","air_date":"2021-05-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/n7ngCf31bt9F4OnpIYrPrM1jBPv.jpg","vote_average":0},"7":{"name":"STRUGGLE","overview":"A tensa partida contra o Colégio Souwa continua. Apesar das dificuldade, Noukin começa a recuperar alguns pontos, mas a partida logo vai acabar!","air_date":"2021-05-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/wlkDg6yrUYj85D6VEsBexodpTBi.jpg","vote_average":0},"8":{"name":"Candidatos ao Clube!","overview":"Depois de um amistoso tenso e fervoroso, surgem algumas pessoas querendo entrar no clube de kabaddi.","air_date":"2021-05-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/5lAsaIVIxKEtyNR06ETyOZCNz1Y.jpg","vote_average":0},"9":{"name":"Uma Batalha de Motivações!","overview":"O time de kabaddi do Colégio Noukin está treinando arduamente para melhorarem suas habilidades. Contudo, Misumi está em um bloqueio de desenvolvimento.","air_date":"2021-05-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/fBtpoAqvQ1n9LARo28aJ85ZjxHZ.jpg","vote_average":0},"10":{"name":"Porque Ele é o Ace","overview":"Depois de um leve treino entre as escolas, Noukin e Kouyou começam o amistoso tão esperando.","air_date":"2021-06-05","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hQqyoP4eJ9dti74zwujvofePfB1.jpg","vote_average":0},"11":{"name":"A Direção Almejada","overview":"A partida intensa entre Kouyou e Noukin continua. Yoigoshi e os demais dão seu melhor para superar o melhor atacante do adversário enquanto o capitão fica fora da quadra.","air_date":"2021-06-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/zj33k0Ac86kfu9HlJszSTj9oQfY.jpg","vote_average":0},"12":{"name":"O que Está Além de Todo o Esforço","overview":"Os momentos finais do amistoso entre Kouyou e Noukin. Os melhores de cada time carregam uma responsabilidade muito grande para assegurar a vitória de seus companheiros.","air_date":"2021-06-19","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/y2yVtRu4Yv6eg9Qba043wWLh6X.jpg","vote_average":0}}}}},
