"246029":{"id":"246029","name":"Viral Hit","slug":"viral-hit","original_title":"喧嘩独学","overview":"O estudante magricelo do ensino médio, Hobin Yu, é provavelmente o último cara que você esperaria ver como protagonista de um canal do NewTube focado em lutas. Mas depois de seguir alguns conselhos que viu em um misterioso canal no NewTube, Hobin logo está derrubando caras bem mais fortes do que ele e ganhando mais dinheiro do que jamais poderia imaginar. Será que Hobin conseguirá manter isso, ou acabará encontrando um adversário à altura?","first_air_date":"2024-04-11","episode_run_time":24,"vote_average":8.3,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["Okuruto Noboru","slowcurve","Fuji Television Network","Crunchyroll","LINE Digital Frontier","dentsu","BS Fuji","GAGA Corporation","Crunchyroll"],"genres":["Animação","Action & Adventure","Comédia"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/wBnmxSBxaP5VrNFVsZuruERb1Cv.jpg","poster_path":"https://image.tmdb.org/t/p/original/biUCx1p4dAImAuqti1caxqKVzE7.jpg","cast":["丹羽哲士","Nobuhiko Okamoto","Fairouz Ai","Yui Ishikawa","Shunsuke Takeuchi"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/biUCx1p4dAImAuqti1caxqKVzE7.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/biUCx1p4dAImAuqti1caxqKVzE7.jpg","air_date":"2024-04-11","episode_count":12,"overview":"N/A","vote_average":6.8,"episodes":{"1":{"name":"Primeira postagem","overview":"A vida de Hobin Yu é uma droga: sua mãe está internada no hospital e todo mundo na escola faz ele de capacho. Mas talvez sua sorte esteja perto de virar.","air_date":"2024-04-11","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xG54T2JtsnR9qSg2nLQMoLghkRs.jpg","vote_average":7},"2":{"name":"Preciso ficar mais forte","overview":"Depois de descobrir um novo mundo dentro do NewTubu, Hobin e Snapper começam a preparar seu plano de vingança contra Pakgo.","air_date":"2024-04-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/sQzxNB9zNNBdkw7qhmlO2WIhdlT.jpg","vote_average":7.6},"3":{"name":"O encontro","overview":"Depois de assistir ao misterioso canal do homem com cabeça de galo, Hobin tem a chance de aplicar as lições dele na prática.","air_date":"2024-04-25","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/x4B0IvkcxKTH8Pz640yITsjc8W8.jpg","vote_average":7},"4":{"name":"Humilhação","overview":"Além de todas as suas inseguranças, Hobin ainda precisa lidar com a presença de Munseong no seu date com Bomi. Será que sua técnica vai deixá-lo na mão?","air_date":"2024-05-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/kXMKdzCLBiHshpDDdcUAWC3xrz1.jpg","vote_average":5.5},"5":{"name":"Amigos","overview":"Depois do incidente no parque com Bomi e Pakgo, Hobin fica um mês sem ir à escola. Mas ele não ficou só em casa, se lamentando.","air_date":"2024-05-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/3PENBE4BoNN2v7uDkns9GTapmLW.jpg","vote_average":5.5},"6":{"name":"O diabo","overview":"Depois de encontrar um editor para agregar valor ao canal, Snapper arruma o próximo desafio de Hobin: um ex-lutador profissional e delinquente juvenil.","air_date":"2024-05-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/kJJJc7xSEFN02NQuupGVTs1M41c.jpg","vote_average":6.5},"7":{"name":"Treino especial","overview":"Aparentemente o confronto contra Taehun agora é inevitável. Além do treinamento de seu \"mestre\", Hobin terá que criar um plano para não apanhar.","air_date":"2024-05-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xYGbuqpmYmuzYbHYIP1jQ55n1oL.jpg","vote_average":6.5},"8":{"name":"Luta real","overview":"Hobin encara sua primeira luta contra um profissional de verdade e parece que seu plano para o combate não deu totalmente certo.","air_date":"2024-05-30","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hK9LA9x37AI2oWHJgOwhS07tUS3.jpg","vote_average":7},"9":{"name":"Amigos","overview":"Os rumores sobre Hobin geram muita desconfiança se são verdadeiros. E, apesar de passar muito tempo, ele recebe apoio para ir atrás de Bomi para se desculpar.","air_date":"2024-06-06","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/uS28JLpgUsG983eCkJBEm3nj4an.jpg","vote_average":5.5},"10":{"name":"Um novo inimigo","overview":"A turma de NewTubers comediantes começa a criar dificuldades para Hobin e seus companheiros.","air_date":"2024-06-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/iCpwUdus92z7JzpdvVulXq6dvVI.jpg","vote_average":10},"11":{"name":"Coração apertado","overview":"Hobin passa vergonha de novo ao tentar salvar Bomi de um apalpador e descobre que está viciado em brigar na rua.","air_date":"2024-06-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/qROsVw77hvNaZecjue1YtXr6r3A.jpg","vote_average":0},"12":{"name":"Alegria","overview":"Uma após a outra, todas as técnicas de Hobin vão sendo desmanteladas por Mangi Hwang. Não vai ter jeito de vencer o gigante lutador?","air_date":"2024-06-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hQqpEYv0gjGp1SXjdPmuaawc4IK.jpg","vote_average":0}}}}},
