"234538":{"id":"234538","name":"DEMON LORD 2099","slug":"demon-lord-2099","original_title":"魔王2099","overview":"A metrópole cyberpunk de Shinjuku — uma enorme cidade-estado decorada com placas de neon, proeminentes arranha-céus e tecnologia de ponta. Foi lá que no ano de 2099 da Era Fundida, onde o lendário Rei Demônio Veltol retornou após cinco séculos. Mas esta paisagem não é nada como a quele conquistou anos atrás, já que a fusão de magia e engenharia elevou a civilização a um patamar deslumbrante e sem precedentes. Veltol pode ter sido reduzido a uma nota de rodapé nos livros de história, mas não se engane... Vai ser ele que vai se apropriar deste admirável mundo novo!","first_air_date":"2024-10-13","episode_run_time":0,"vote_average":8.217,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["J.C.STAFF","Aniplex"],"genres":["Animação","Sci-Fi & Fantasy","Action & Adventure"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/rS6CNUPU62dsSmsPieLGm6NceZa.jpg","poster_path":"https://image.tmdb.org/t/p/original/mU7QgTm2WadwVoT7jDyMY9Czpsj.jpg","cast":["Satoshi Hino","Miku Ito","Hana Hishikawa","Daisuke Namikawa","松風雅也"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/mU7QgTm2WadwVoT7jDyMY9Czpsj.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/mU7QgTm2WadwVoT7jDyMY9Czpsj.jpg","air_date":"2024-10-13","episode_count":12,"overview":"N/A","vote_average":9.5,"episodes":{"1":{"name":"Shinjuku, a Cidade Cyberpunk","overview":"Veltol volta à vida em um mundo diferente do que ele conhecia e precisa se adaptar a uma nova realidade.","air_date":"2024-10-13","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/wYr3HWgCkBUK2xfSnzbAHbua6WZ.jpg","vote_average":9.3},"2":{"name":"O Lorde Demônio e Seus Vassalos","overview":"Veltol decide que o melhor é se adaptar aos tempos modernos e suas mudanças e quer arranjar um emprego...","air_date":"2024-10-20","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dV8zxzgQTWE2O1msnwJ9aQ1bKzr.jpg","vote_average":9},"3":{"name":"(Primeira Live) O Lorde Demõnio Veltol","overview":"Por sugestão de Takahashi, amiga de Machina, Veltol começa a fazer lives de gameplay com o rosto à mostra.","air_date":"2024-10-27","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/pCLu1OYl4WVdyhxqjwtSwFy9MFr.jpg","vote_average":9},"4":{"name":"As Sombras de Shinjuku","overview":"Takahashi pede a Veltol que faça um trabalho como seu guarda-costas, e ele aceita querendo testar a força que recuperou com a fé de seus inscritos. No entanto, o que era um simples roubo vai fazê-los adentrar as trevas da cidade...","air_date":"2024-11-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/ecnudmJT27zvJYE5H9TZMBwzwxY.jpg","vote_average":9},"5":{"name":"O Fundo do Caldeirão","overview":"Machina é levada e Veltol tem poucas opções de ajuda para ir salvar sua vassala.","air_date":"2024-11-10","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/8OCev7WSr4iLrGHDBDEQNUELIuL.jpg","vote_average":10},"6":{"name":"A Batalha do Herói","overview":"Na Fornalha Imortal, abaixo do Reator Eterial de Shinjuku. Marcus conta a Machina a terrível verdade sobre a imortalidade. Enquanto isso, Kinohara bloqueia o caminho de Veltol e dos outros.","air_date":"2024-11-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/quFWM6Y7p8irwQpf3EpZzMjlvYS.jpg","vote_average":10},"7":{"name":"A Ressurreição do Lorde Demônio","overview":"Para resgatar Machina, Veltol enfrenta Marcus. Será que desta vez ele sairá vencedor?","air_date":"2024-11-24","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hP7hJX790ykj9Y3MSA09RHWmqdS.jpg","vote_average":10},"8":{"name":"Akihabara, a Cidade Cybermágica","overview":"Na Escola de Magia de Akihabara Lu Xel, Hizuki Reynard-Yamada passa seus dias sentada no canto da sala, suspirando profundamente. Enquanto isso, Veltol, depois de derrotar Marcus e resgatar Machina, se dirige para a cidade de Akihabara, onde ele talvez encontre o que procura.","air_date":"2024-12-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/jRJyE05fNJDY3XX05BowGOhsjGt.jpg","vote_average":9},"9":{"name":"A Aluna Pobre e o Intercambista","overview":"Veltol arruma briga com um colega que está insultando Hizuki, e é desafiado para um duelo. Depois da aula, Veltol, Machina e Takahashi vão atrás de pistas sobre as Regalia.","air_date":"2024-12-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hvIle9xqPJbpq6WsGne6kmMsimo.jpg","vote_average":10},"10":{"name":"As Três Grandes Casas de Akihabara","overview":"Veltol e os outros vão ao Maid Café onde Hizuki trabalha. Depois de constrangê-la fazendo com que os trate bem por serem clientes, Veltol pergunta a Hizuki sobre as Regalia, e os quatro saem para andar por Akihabara.","air_date":"2024-12-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/gUSOnODrc45dS0XZ8EYEWSqbwQc.jpg","vote_average":10},"11":{"name":"A Deusa Reencarnada","overview":"Depois de passearem pela Cidade Elétrica, todos se divertem na casa de Hizuki. No dia seguinte, na escola, ela ouve falar a respeito de uma explosão que ocorreu na noite anterior, e descobre uma verdade terrível.","air_date":"2024-12-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hbNSGFwkeAuqZJcRXCMocy7jQy.jpg","vote_average":9},"12":{"name":"O Retorno do Lorde","overview":"A Deusa Meldia se manifestou no corpo de Hizuki, graças ao plano de Mag Rosanta, e Veltol luta contra ela para salvar sua nova amiga. Enquanto isso, Machina luta contra a garota de visor misteriosa; e a cidade de Akihabara parece prestes a entrar em guerra.","air_date":"2024-12-28","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/2iq4ALBeAEWe48F4j6bXsjh042O.jpg","vote_average":10}}}}},
