"238903":{"id":"238903","name":"Vampire Dormitory","slug":"vampire-dormitory","original_title":"ヴァンパイア男子寮","overview":"Após perder seus pais e ser abandonada por parentes, Mito fica completamente sozinha no mundo. Quando é expulsa do restaurante onde trabalha, sem dinheiro e sem ter onde morar, ela é acolhida por Ruka, um vampiro. Em troca de fornecer seu sangue a Ruka para servir como sua \"alimentação\", ela acaba vivendo com ele em um dormitório masculino cheio de garotos bonitos com personalidades únicas…","first_air_date":"2024-04-07","episode_run_time":24,"vote_average":5.143,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["Studio Blanc.","avex pictures","Kodansha","dentsu","Crunchyroll","Crunchyroll"],"genres":["Animação","Drama","Sci-Fi & Fantasy"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/wrSbw5nb5ep9tHJvR1qewKk0Iit.jpg","poster_path":"https://image.tmdb.org/t/p/original/22c8lGyJv5fph12Wk518spTjPFo.jpg","cast":["市ノ瀬加那","土岐隼一","Yuichiro Umehara","羽多野渉","白井悠介"],"trailer":"w5T3VN53_Us","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/dCJkD8y7tQJStY8VpIhkG4O1hI6.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/dCJkD8y7tQJStY8VpIhkG4O1hI6.jpg","air_date":"2024-04-07","episode_count":12,"overview":"N/A","vote_average":2,"episodes":{"1":{"name":"O belo moço é escolhido.","overview":"Sem família, sem ter onde morar, e logo após perder o emprego que tanto lhe custou achar, Mito entra por acidente num restaurante para fugir da chuva e acaba conhecendo Ruka, um vampiro disfarçado de humano. O sangue de Mito, alguém que nunca teve nenhum amor, tem gosto horrível. Mas Ruka tem motivos para mudar essa situação...","air_date":"2024-04-07","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dIaOFwZIfSHbi9UnmgBJjHQT4NM.jpg","vote_average":2},"2":{"name":"O belo moço vira alvo.","overview":"Mito, ainda escondendo o fato de que é uma garota, vai para a escola Hijirigaoka, onde Ruka estuda, e conhece seus colegas de turma. Porém, ela acaba atraindo a atenção de Ren, o delinquente da sala...","air_date":"2024-04-14","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/oRXkGYybmlZwjEpW3CPktbTQn9N.jpg","vote_average":0},"3":{"name":"O belo moço passa a noite.","overview":"Mito, já acostumada em trabalhar disfarçada de homem, é convidada para um \"glamping\", um acampamento mais \"glamoroso\", como uma festa de boas-vindas dos colegas de trabalho. Além disso, mesmo ficando mais perto de Ruka, Ren também aparece por lá...","air_date":"2024-04-21","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/9vG5EpbekRbR2nPmLSZloTCqy6r.jpg","vote_average":0},"4":{"name":"O belo moço se torna amigo.","overview":"Ruka tenta evitar Mito para não se apaixonar, já que ele já tem uma \"parceira predestinada\", como Komori disse. Mas Mito sente sua falta e decide questioná-lo.","air_date":"2024-04-28","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/9cYbxtDuqNmCFSIVy3nawcreXGm.jpg","vote_average":0},"5":{"name":"O belo moço foge de casa.","overview":"Ren age de forma estranha e Mito agora suspeita que seu amigo seja um vampiro também. Além disso, seus sentimentos por Ruka tornam ainda mais doloroso ficar perto dele.","air_date":"2024-05-05","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/15pXuyb4kvGRZCrf0MUrk6ybwFl.jpg","vote_average":0},"6":{"name":"O belo moço está de coração partido?!","overview":"Mito, arrasada em ter deixado o Ruka tão irritado, recebe um convite para ir à praia com Juri e Takara para se divertir um pouco.","air_date":"2024-05-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tiet2A7riROH0EbzzGDtbhVa869.jpg","vote_average":0},"7":{"name":"O belo moço vai a um encontro.","overview":"Mito convida Ruka para ver os fogos de artifício em um festival. Ruka aceita, mas enquanto a lua nova escurece o céu, ele precisará resolver uma pendência...","air_date":"2024-05-19","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/6MRAgNVXgVCHXU7BiLDBAOOVUqc.jpg","vote_average":0},"8":{"name":"O belo moço tem um encontro do destino.","overview":"Ren descobre que Mito é mulher e fica em choque com a revelação. Enquanto isso, Ruka precisa lidar com a indignação do seu povo por ele não ir atrás de sua parceira predestinada.","air_date":"2024-05-26","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4RF1T3HIDlSXHwkd2QRmLadaA0e.jpg","vote_average":0},"9":{"name":"O belo moço vai a uma festa.","overview":"O Café La Fraise faz uma reforma para atrair mais clientes e Ren decide fazer um bico por lá. Mito não sabe como reagir depois da declaração do Ren, que insiste em ficar perto dela a todo custo.","air_date":"2024-06-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/5s6bCDJeL0Bc7keRxkR5XvRL5KM.jpg","vote_average":0},"10":{"name":"O belo moço muda de corpo.","overview":"Por causa do desejo de Ren, Mito agora tem corpo de homem. Por mais que queira voltar a seu corpo antigo, Ren se recusa, pois isso significaria perdê-la para Ruka. Enquanto isso, Juri junta coragem para se declarar a Takara.","air_date":"2024-06-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/buk4wG3pBVALnC3AHl4qLADBSoJ.jpg","vote_average":0},"11":{"name":"O belo moço se afoga.","overview":"Ruka escolheu Miko. Mito cai na água, mas ao seu resgate surge um loiro misterioso. Na mansão de Ren, Mito pede para se esquecer de Ruka.","air_date":"2024-06-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/wnxV73ugGoEFQttqNZGI6qgFgBP.jpg","vote_average":0},"12":{"name":"O belo moço faz um juramento?!","overview":"Chega o dia do casamento de Mito e Ren, mas Ruka decide se encontrar com Mito uma última vez para lhe entregar o antigo sang sucre.","air_date":"2024-06-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/GYT8hRQgotuMskQdU8CpUC3jni.jpg","vote_average":0}}}}},
